// BytesCompressToString
var BytesCompressToString = func(b []byte) string {
	return base64.StdEncoding.EncodeToString(snappy.Encode(nil, b))
}

// StringUnCompressToBytes
var StringUncompressToBytes = func(s string) ([]byte, error) {
	// decode
	decoded, err := base64.StdEncoding.DecodeString(s)
	if err != nil {
		return nil, err
	}
	// unCompress
	ret, err := snappy.Decode(nil, decoded)
	if err != nil {
		return nil, err
	}
	return ret, err
}

func pb() {
	var a = `{"GUID":"936a0d57153b6ae648731e3313b788cb","ReqID":"936a0d57153b6ae648731e3313b788cb63511619012769523169219188","CardIDItemListMap":{"0522":{"ItemID":["1134449057","1125673686","1125682057"]}},"UserFeatureInfo":{"PEFeature":""},"ExperID":"969632_1536605_1390354_741493_1896705_1748144_1560236_1894776_1810410_803893_1789784_1536717_1918535_969627_1547471_969630_1584413_1789776_1489468_1789787_1923673","ItemFeatureInfoMap":{"1125673686":null,"1125682057":null,"1134449057":null}}`
	sample := common.SampleUserFeature{}

	if err := json.Unmarshal([]byte(a), &sample); err != nil {
		log.Println(err)
	}
	log.Println(sample.String())

	sampleByte, _ := proto.Marshal(&sample)
	fmt.Println("sample byte size ", binary.Size(sampleByte))

	fmt.Println("sample json size ", binary.Size([]byte(a)))
	sampleBase64 := base64.StdEncoding.EncodeToString(sampleByte)

	fmt.Println("sample base64 size ", binary.Size([]byte(sampleBase64)))

	encoded := snappy.Encode(nil, sampleByte)
	fmt.Println("sample snappy byte size ", binary.Size(encoded))

	fmt.Println("sample snappy json str size ", binary.Size([]byte(utils.ToJson(encoded))))

	sampleByteStr := utils.ToJson(sampleByte)
	//fmt.Println("sample base64 size", binary.Size([]byte(utils.ToJson(sampleByte))))
	//fmt.Println(sampleByteStr)

	var mm []byte
	err := json.Unmarshal([]byte(sampleByteStr), &mm)
	if err != nil {
		log.Println(err)
	}
	//fmt.Println(mm)

	mmSample := common.SampleUserFeature{}
	err = proto.Unmarshal(mm, &mmSample)
	if err != nil {
		log.Println(err)
	}
	fmt.Println(mmSample.String() == sample.String())

}

